import React from "react"
import {Navigate, useNavigate} from "react-router-dom"
import "./Navbar.css"
function Navbar(){
    const navigate=useNavigate();
    return(
        <div> 
          <a class="btn btn-outline-success" type="button" href="/Home">Home</a>
          <a class="btn btn-outline-success" type="button" href="/Addblog">Add blog</a>
          <a class="btn btn-outline-success" type="button" href="/Signup">Signup</a>
          </div>
    )
}
 export default Navbar
